import Layout from "../components/Layout";
import React from "react";
import styled from "styled-components";
import Icon from "../components/Icon";
const CategorySection = styled.section`
    > ul {
      display: flex;
      flex-direction: row;
      background-color: rgb(254,251,240) ;
      margin-bottom: 5px;
      margin-top: 20px;
      height: 50px;
      >li{
        width: 50%;
        text-align: center;
        font: inherit;
        font-size: 24px;
        padding: 10px 0;
        border: 2px solid black;
        border-radius: 10px;
        margin-right: 20px;
        margin-left: 20px ;
        background-color: rgb(246,208,110);
        &.selected{
          background-color: rgb(246,209,180);
          border: 2px solid black;
        }
      }
    }
`
const NumberPadSection = styled.section`
  display: flex;
  flex-direction: column;
  background-color: rgb(246,209,105);
  border-top: 2px solid black;
  border-bottom-right-radius: 10px;
  border-bottom-left-radius: 10px;
  font-weight: bolder;
  margin-right: 0.5px;
    >.note{
      margin-top: 5px;
      display: flex;
      height: 36px;
      text-align: center;
      flex-direction: row;
      align-items: center;
      padding-right: 15px;
      padding-left: 15px;
      flex-wrap: nowrap;
      font-size: 20px;
      >input{
        height: 100%;
        margin-right: 5px;
        margin-left: 5px;
        background: none;
        border:none;
        max-width: 30%;
      }
      .output{
        width: auto;
        line-height: 72px;
      }
    }
  >.pad{
    padding-left: 1%;
    > button{
      background-color: rgb(255,255,255);
      box-shadow: inset 0 -5px 0px rgba(0,0,0,0.25);
      border-radius: 10px;
      border: 2px solid black;
      margin-right: 1%;
      margin-bottom: 1%;
      font-size: 18px;
      float:left;
      width: 24%;
      height: 56px;
      font-weight: bolder;  
      &.OK{
        height: 116px;
        float: right;
        background-color: rgb(232,130,148);
        color:white;
      }
      &.dot{
        width: 49%;
      }
    }
  }
`
const TagList = styled.ol`
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  //border: 1px solid black;
  width: 370px;
  padding : 20px;
  flex-grow: 1;
  background-color: rgb(254,251,240);
  align-content:flex-start;
  >li{
    background-color: rgb(246,208,160);
    width: 50px;
    height: 50px;
    margin-right: 20px;
    margin-bottom: 20px;
    text-align: center;
    border: 2px solid black;
    border-radius: 50%;
    display: flex;
    flex-direction: column;
    align-items: center;
    font: inherit;
    font-size: 12px;
    font-weight: bolder;
    &.last{
      
    }
    .icon{
      display: inline-block;
      margin-top: 2px;
      fill:none;
    }
  }
  li:nth-child(5n){
    margin-right: 0px;
  }
`
const MyLayout = styled(Layout)`
    display: flex;
    flex-direction: column;
`
function Count() {
    return (
        <MyLayout>
                <CategorySection>
                    <ul>
                        <li className = "selected">支出</li>
                        <li>收入</li>
                    </ul>
                </CategorySection>
                <TagList>
                    <li><Icon name="food" ></Icon>餐饮</li>
                    <li><Icon name="rent" ></Icon>房租</li>
                    <li><Icon name="clothes" ></Icon>服装</li>
                    <li><Icon name="entertainment" ></Icon>娱乐</li>
                    <li><Icon name="travel" ></Icon>旅行</li>
                    <li><Icon name="makeup" ></Icon>美容</li>
                    <li><Icon name="car" ></Icon>汽车</li>
                    <li><Icon name="beverage" ></Icon>饮品</li>
                    <li><Icon name="pet" ></Icon>宠物</li>
                    <li><Icon name="shopping" ></Icon>购物</li>
                    <li><Icon name="vacation" ></Icon>度假</li>
                    <li className="last"><Icon name="settings"/>设置</li>
                </TagList>
                <NumberPadSection>
                    <div className="note">
                        备注:
                        <input placeholder="添加备注"/>
                        $:
                        <div className="output">
                            12345678910
                        </div>
                    </div>
                    <div className="pad">
                        <button>1</button>
                        <button>2</button>
                        <button>3</button>
                        <button>DELETE</button>
                        <button>4</button>
                        <button>5</button>
                        <button>6</button>
                        <button>CLEAR</button>
                        <button>7</button>
                        <button>8</button>
                        <button>9</button>
                        <button className="OK">OK</button>
                        <button>0</button>
                        <button className="dot">.</button>
                    </div>
                </NumberPadSection>
        </MyLayout>
    );
}
export default Count;
